{'links': [], 'post_id': '1551271746882132470_198154074', 'hashtags': 'CelineTakesCouture', 'caption': 'Celine Dion doesn't try to hide her feelings. Her candor is one of her many charms, coupled with lovely manners and an emotional transparency that's unique in anyone (let alone a global popstar for over 30 years). Last year at the haute couture show for Giambattista Valli, she sang, clapped, oohed and cooed, before ultimately going backstage post-show to weep with Giamba and his mama. "No one else was applauding," she recalls slightly sheepishly as she waits to enter the Petit Palais for this summer's Valli catwalk. She is joined by a featured dancer in her European show by the name of Pepe Munoz. Pepe is a Spaniard, originally from Malaga; he is also a budding fashion illustrator (@pepemunozillustrations). Celine was introduced to Pepe by Las Vegas show folks she knows through her butler's wife, who is a dancer herself. ("All the people I meet," says Dion of her Vegas social life, "are acrobats, dancers, or divers. That's family.") Now the two are fast pals, inseparable onstage (her in a jeweled, super-heroic unitard, him in his basic helpless hotness) and off. 
And so when, this season, Celine decides to express her exuberant enthusiasm for Valli's work it is by making flamenco hand signals to Pepe, who is across the aisle, and his front row neighbors, actress Rossy de Palma and the esteemed Spanish choreographer Blanca Li.

And there are far too many runway winners to count. A delicate tiny floral tee-shirt of fully embroidered tulle worn with a collar or harness of black pailettes. Ball dresses of chantilly lace, pleated tulle, or broderie anglais, cut high in the front, trained in the back. This is a full-on Celine show in every sense. Celine's hands are twirling; Pepe's hands are Voguing; Rossy is inexplicably doing scissor kicks.... The models (the lucky ones!) are gliding by in ballet shoes, but the dancing is all going down in the seats. When it ends, Pepe is in tears. Blanca is in heaven. And Celine is saying that next year, if she is on tour in Europe, she will ask to have the whole week of the shows off from performing. "But they won't let me," she laughs, "for fear I will spend too much money!" #CelineTakesCouture Photographed by @denisetruscello.', 'comment_count': 157, 'like_count': 61255, 'link': 'https://www.instagram.com/p/BWHOW9PAln2/', 'filter_name': 'Normal', 'image_url': 'https://scontent.cdninstagram.com/t51.2885-15/s640x640/sh0.08/e35/c180.0.720.720/19764566_1432311796847650_4884170082399289344_n.jpg'}

